import { IPokerHomepageContainerState } from "../../shared";

import { createStructuredSelector } from 'reselect';
import { IApplicationState } from '../../shared';

function createPokerHomepageSelector(property: string) {
  return(state: IApplicationState) => {
    return state.pokerHomepage[property];
  }
}

export const pokerHomepageSelector = createStructuredSelector({
  clientId: createPokerHomepageSelector("clientId"),
  clientName: createPokerHomepageSelector("clientName")
});
